(1, -10, 3, 'Vous avez remis votre travail pour le devoir Examen de fin de Cours ', 'JEE -> Devoir -> Examen de fin de Cours \n---------------------------------------------------------------------\nVous avez remis un travail pour le devoir «&nbsp;Examen de fin de Cours &nbsp;».\n\nVous pouvez consulter l\'état de votre travail&nbsp;: http://localhost/moodle/mod/assign/view.php?id=21\n\n---------------------------------------------------------------------\n', 2, '<p><font face=\"sans-serif\"><a href=\"http://localhost/moodle/course/view.php?id=4\">JEE</a> -><a href=\"http://localhost/moodle/mod/assign/index.php?id=4\">Devoir</a> -><a href=\"http://localhost/moodle/mod/assign/view.php?id=21\">Examen de fin de Cours </a></font></p><hr /><font face=\"sans-serif\"><p><p>Vous avez remis un travail pour le devoir «&nbsp;<em>Examen de fin de Cours </em>&nbsp;»</p>\n<p>Vous pouvez consulter l\'état de votre <a href=\"http://localhost/moodle/mod/assign/view.php?id=21\">travail</a>.</p></p></font><hr />', 'Vous avez remis votre travail pour le devoir Examen de fin de Cours ', 'mod_assign', 'assign_notification', 'http://localhost/moodle/mod/assign/view.php?id=21', 'Examen de fin de Cours ', NULL, 1562248234, '{\"cmid\":\"21\",\"instance\":\"1\",\"messagetype\":\"submissionreceipt\",\"blindmarking\":false,\"uniqueidforuser\":\"1\",\"courseid\":\"4\"}'),
(2, 3, 2, 'Contact request from MedAli Bousarsar', '<div class=\"text_to_html\">MedAli Bousarsar is requesting to be added as a contact.</div>', 1, 'MedAli Bousarsar is requesting to be added as a contact.', '', 'moodle', 'messagecontactrequests', 'http://localhost/moodle/message/pendingcontactrequests.php', NULL, 1562249546, 1562248432, '{\"notificationiconurl\":\"http:\\/\\/localhost\\/moodle\\/theme\\/image.php\\/academi\\/core\\/1562237438\\/u\\/f2\",\"actionbuttons\":{\"accept\":\"Accept\",\"reject\":\"Reject\"},\"courseid\":\"1\"}'),
(3, -10, 8, 'You have submitted your assignment submission for Examen de fin de cours', 'Symfony/PHP -> Assignment -> Examen de fin de cours\n---------------------------------------------------------------------\nYou have submitted an\nassignment submission for \'Examen de fin de cours\'\n\nYou can see the status of your assignment submission:\n\n    http://localhost/moodle/mod/assign/view.php?id=25\n\n---------------------------------------------------------------------\n', 2, '<p><font face=\"sans-serif\"><a href=\"http://localhost/moodle/course/view.php?id=3\">Symfony/PHP</a> -><a href=\"http://localhost/moodle/mod/assign/index.php?id=3\">Assignment</a> -><a href=\"http://localhost/moodle/mod/assign/view.php?id=25\">Examen de fin de cours</a></font></p><hr /><font face=\"sans-serif\"><p><p>You have submitted an assignment submission for \'<i>Examen de fin de cours</i>\'.</p>\n<p>You can see the status of your <a href=\"http://localhost/moodle/mod/assign/view.php?id=25\">assignment submission</a>.</p></p></font><hr />', 'You have submitted your assignment submission for Examen de fin de cours', 'mod_assign', 'assign_notification', 'http://localhost/moodle/mod/assign/view.php?id=25', 'Examen de fin de cours', NULL, 1563958417, '{\"cmid\":\"25\",\"instance\":\"2\",\"messagetype\":\"submissionreceipt\",\"blindmarking\":false,\"uniqueidforuser\":\"4\",\"courseid\":\"3\"}');
